to_export = 'scores'
to_charge = 'MAE'

def calculate_average(*datasets, key):
    """
    Calculate the average of a specified key across multiple datasets.
    """
    from collections import defaultdict

    aggregated_data = defaultdict(
        lambda: defaultdict(lambda: defaultdict(lambda: defaultdict(lambda: defaultdict(list))))
    )

    # Aggregate values across runs
    for data in datasets:
        for dataset, scenarios in data.items():
            for scenario, algorithms in scenarios.items():
                for algorithm, methods in algorithms.items():
                    for method, levels in methods.items():
                        for level, values in levels.items():
                            aggregated_data[dataset][scenario][algorithm][method][level].append(values)

    # Calculate averages
    averaged_data = defaultdict(lambda: defaultdict(lambda: defaultdict(lambda: defaultdict(dict))))
    for dataset, scenarios in aggregated_data.items():
        for scenario, algorithms in scenarios.items():
            for algorithm, methods in algorithms.items():
                for method, levels in methods.items():
                    for level, value_lists in levels.items():
                        avg_values = {}
                        # Ensure key exists before accessing
                        if key in value_lists[0][to_export]:
                            for metric, values_list in value_lists[0][to_export].items():
                                avg_values[metric] = sum(
                                    d[to_export].get(metric, 0) for d in value_lists
                                ) / len(value_lists)
                            averaged_data[dataset][scenario][algorithm][method][level] = {to_export: avg_values}
                        else:
                            print(f"Warning: Key '{key}' not found in value_lists for {dataset} -> {scenario} -> {algorithm} -> {method} -> {level}")
                            averaged_data[dataset][scenario][algorithm][method][level] = {to_export: {}}

    return averaged_data


def generate_export(*datasets):
    # Calculate average across datasets
    averaged_data = calculate_average(*datasets, key=to_charge)

    # Define colors and markers for each algorithm
    algorithm_styles = {
        'mean': {'color': 'cyan', 'mark': 'o'},
        'cdrec': {'color': 'urobilin', 'mark': 'square'},
        'stmvl': {'color': 'darkgreen', 'mark': 'triangle'},
        'iim': {'color': 'red', 'mark': 'diamond*'},
        'mrnn': {'color': 'violet', 'mark': '+'}
    }

    output = ""
    for dataset, scenarios in averaged_data.items():
        for scenario, algorithms in scenarios.items():
            for algorithm, methods in algorithms.items():
                style = algorithm_styles.get(algorithm, {'color': 'black', 'mark': '*'})  # Default if not found
                color = style['color']
                mark = style['mark']
                output += f"% {algorithm}\n"
                output += f"\\addplot+[color={color}, mark={mark}] coordinates {{\n"
                for method, levels in methods.items():
                    for level, values in levels.items():
                        contamination_level = int(float(level) * 100)
                        imputation_time = values.get(to_export, {}).get(to_charge, 0)  # Use .get() to avoid KeyError
                        output += f"    ({contamination_level}, {imputation_time})\n"
                output += "};\n\n"
    return output

def export_to_plot(contamination, ground_truth, limit=1):
    """
    Exports a limited number of time series in the \addplot format for use in LaTeX/TikZ.
    Plots NaN values in red without connecting lines or marks, and handles gaps between segments.

    Parameters
    ----------
    contamination : list or array-like
        The original values before contamination.
    limit : int, optional
        The number of series to export. Default is 1.

    Returns
    -------
    None
    """
    for i, series in enumerate(contamination[:limit]):
        output_cyan = "\\addplot+[color=cyan, mark=none] coordinates {\n"
        output_red = "\\addplot+[color=red, mark=none] coordinates {\n"

        continuous_segment = []
        nan_segment = []
        for j, elem in enumerate(series):
            if not math.isnan(elem):
                # Add to continuous segment for regular values
                if nan_segment:
                    # If there was a previous NaN segment, close it
                    output_red += "    " + " ".join(nan_segment) + "\n};\n"
                    output_red += "\\addplot+[color=red, mark=none] coordinates {\n"
                    nan_segment = []  # Reset NaN segment

                continuous_segment.append(f"({j}, {elem:.10f})")
            else:
                # Handle NaN segments separately
                if continuous_segment:
                    # Close the current continuous segment
                    output_cyan += "    " + " ".join(continuous_segment) + "\n};\n"
                    output_cyan += "\\addplot+[color=cyan, mark=none] coordinates {\n"
                    continuous_segment = []  # Reset continuous segment

                # Add to red plot for NaN (no mark)
                nan_segment.append(f"({j}, {ground_truth[i][j]:.10f})")

        # Handle any remaining continuous segments
        if continuous_segment:
            output_cyan += "    " + " ".join(continuous_segment) + " "
        output_cyan += "};"

        # Handle any remaining NaN segments
        if nan_segment:
            output_red += "    " + " ".join(nan_segment) + " "
        output_red += "};"

        # Print outputs
        print(output_cyan)
        print(output_red)


